import React, { useState } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faBars, faTimes, faQrcode, faLink, faStream, faCalendarWeek, faQuestionCircle, faSlidersH, faPhoneVolume, faComments } from '@fortawesome/free-solid-svg-icons';
import { faFacebookF, faTwitter, faInstagram, faYoutube } from '@fortawesome/free-brands-svg-icons';

import About from './About';
import './com'
import { Routes, Route, Link } from 'react-router-dom';

export default function Navbart() {
  const [isChecked, setIsChecked] = useState(false);

  const handleCheckboxChange = () => {
    setIsChecked(!isChecked);
  };

  return (
    <>
      <div>
        <ul>
          <li><Link to="/About">About</Link></li>
        </ul>
      </div>

      <Routes>
        <Route exact path='/About' element={<About />} />
      </Routes>

      <div>
        <input type="checkbox" id="check" checked={isChecked} onChange={handleCheckboxChange} />
        <label className="button bars" htmlFor="check"><FontAwesomeIcon icon={faBars} /></label>

        <div className={`side_bar ${isChecked ? 'open' : ''}`}>
          <div className="title">
            <div className="logo">CodingLab</div>
            <label className="button cancel" htmlFor="check"><FontAwesomeIcon icon={faTimes} /></label>
          </div>

          <ul>
            <li><a href="#"><FontAwesomeIcon icon={faQrcode} />Dashboard</a></li>
            <li><a href="#"><FontAwesomeIcon icon={faLink} />Shortcuts</a></li>
            {/* ... other list items ... */}
          </ul>

          <div className="media_icons">
            <a href="#"><FontAwesomeIcon icon={faFacebookF} /></a>
            <a href="#"><FontAwesomeIcon icon={faTwitter} /></a>
            <a href="#"><FontAwesomeIcon icon={faInstagram} /></a>
            <a href="#"><FontAwesomeIcon icon={faYoutube} /></a>
          </div>
        </div>
      </div>
    </>
  );
}
